import React, { useEffect, useState } from 'react';
import logo from './logo.svg'; // Ensure this is the path to your logo
import './App.css';

function App() {
  const [showImage, setShowImage] = useState(true);

  useEffect(() => {
    // Hide the image after 2 seconds
    const timer = setTimeout(() => {
      setShowImage(false);
    }, 2000);

    // Clean up the timer
    return () => clearTimeout(timer);
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Echo Call!</h1>
        {showImage && (
          <img 
            src={logo} 
            className="App-logo" 
            alt="logo" 
            style={styles.image}
          />
        )}
        {!showImage && <p>The image has disappeared!</p>}
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

// Optional styles for the image
const styles = {
  image: {
    maxWidth: '70%',
    height: 'auto',
    animation: 'logo-animation 2s infinite',
    filter: 'drop-shadow(0 0 10px black)',
  }
};

export default App;
